import axios from 'axios';

class DataService {
  getData(username) {
      const options = {
        headers: {
          'Authorization': 'Bearer ' + localStorage.getItem("authorization"),
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin": "*",
          "Access-Control-Allow-Methods": "DELETE, POST, GET, OPTIONS",
          "Access-Control-Allow-Headers": "Content-Type, Access-Control-Allow-Headers, Authorization, X-Requested-With",
          'Access-Control-Allow-Credentials' : 'true'
        },
        responseType:'blob',
      };
      return axios.get("http://localhost:8080/data?username=" + username, options, {
        responseType:'blob',
      });
  }

  getRawData(username) {
    const options = {
      headers: {
        'Authorization': 'Bearer ' + localStorage.getItem("authorization"),
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": "*",
        "Access-Control-Allow-Methods": "DELETE, POST, GET, OPTIONS",
        "Access-Control-Allow-Headers": "Content-Type, Access-Control-Allow-Headers, Authorization, X-Requested-With",
        'Access-Control-Allow-Credentials' : 'true'
      },
      responseType: 'blob'
    };
    return axios.get("http://localhost:8080/rawdata?username=" + username, options);
  }

  getDecodedData() {
    const options = {
      headers: {
        'Authorization': 'Bearer ' + localStorage.getItem("authorization"),
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": "*",
        "Access-Control-Allow-Methods": "DELETE, POST, GET, OPTIONS",
        "Access-Control-Allow-Headers": "Content-Type, Access-Control-Allow-Headers, Authorization, X-Requested-With",
        'Access-Control-Allow-Credentials' : 'true'
      }
    };
    return axios.get("http://localhost:8080/decodeddata", options);
  }
}

export default new DataService()
